import React from 'react';

const List = ({ people }) => {
  return (
    <>
     
      
        return (
          <article>
            <img src={people.profilePicture} alt={people.name} />
            <div>
              <h4>{people.name}</h4>
              {/* <p>{age} years</p> */}
            </div>
          </article>
        );
     
    </>
  );
};

export default List;
